import React, { useState, useEffect } from 'react';
import Link from 'next/link';
import styled from 'styled-components';
import { debounce } from './../src/utilities/helpers';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { 
  faShoppingCart,
} from '@fortawesome/free-solid-svg-icons';

const BookingDetails = styled.div`

    .booking-details-heading {
		background-color: #f5f5f5;
        padding: 10px 20px;
	}

    .my-wines-list__content-wrapper {
        padding: 1.5rem 1.75rem;
        display: flex;
    }

    .my-wines-list__image {
        width: 4.6875rem;
        height: 3.125rem;
        flex-shrink: 0;
    }
`;

export default function Nav() {

	return (
        <BookingDetails>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-9">
                        <h3 className="font-weight-bold pb-4">
                            Booking Confirmed
                        </h3>
                        <div>
                            <p className="">
                                You booking has been made please see the details below.
                            </p>
                            <p className="">
                                You booking confirmation number is <b>RDL232323</b>.
                            </p>
                            <p className="">
                                Please keep a record of this number for any communication with our customer services team.
                            </p>

                            <div className="booking-details-heading font-weight-bold">YOUR BOOKING DETAILS</div>

                            <div class="my-wines-list__content-wrapper">
                                <div class="my-wines-list__image">
                                    <img src="https://via.placeholder.com/68x52.png" alt="" />
                                </div>

                                <div class="my-wines-list__content">
                                    <h3 class="my-wines-list__title">
                                    London Heritage Red 2020
                                    </h3>
                                    <ul class="my-wines-list-details">
                                    <li class="my-wines-list-details__item my-wines-list-details__item--code">
                                        Code: JT4045
                                    </li>
                                    <li class="my-wines-list-details__item">
                                        Purchased: 2 Mar 2019 for £39.50
                                    </li>
                                    </ul>
                                </div>
                            </div>
                        </div>
                    </div>
                    <div className="col-lg-3">
                    </div>
                </div>
            </div>
        </BookingDetails>
  	);
}
